          "comment": "On career-high mark but might be keeping on when others have cried enough",
          "spotlight": "Came from a long way off the pace to beat Imperial Data in quite valuable series final at Kelso (2m5f, good to soft) in March, her fifth hurdling success; current mark demands a career-best performance but she ran well over this C&D last summer and might be keeping on when others have cried enough.",
