          "comment": "Not quite as good as he was but still a useful performer; enters calculations",
          "spotlight": "Not quite as good as he was but still a useful performer; placed on final two starts last season (2m hurdle/2m1f chase) and drops back in trip after looking stretched by 2m4f last month; probably best on good/good to soft but has won on soft; enters calculations.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-11-22",
              "horse": "Aucunrisque",
              "horse_id": "3223906",
              "race": "LK Bennett Autumn Collection Handicap Hurdle",
              "race_id": "880123",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "15.5",
              "distance_y": "3452",
              "quote": "They went off like the clappers to start off with and I was the first off the bridle. Aucunrisque always puts in a good race and he's a good, tough horse - Freddie Gordon, jockey."
            },
            {
              "date": "2023-02-11",
              "horse": "Aucunrisque",
              "horse_id": "3223906",
              "race": "Betfair Hurdle (Handicap) (Premier Handicap) (GBB Race)",
              "race_id": "829592",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "16.5",
              "distance_y": "3589",
              "quote": "We'll go for the Grand Annual with him now. Aucunrisque is a wonderful, tough, consistent horse who gives me no issues at all. It makes life so easier when he's straightforward. I thought about going for the Lightning Novices' Chase at Doncaster, but I didn't want to pick up a couple more pounds in the handicap - Chris Gordon, trainer."
            },
            {
              "date": "2022-01-02",
              "horse": "Aucunrisque",
              "horse_id": "3223906",
              "race": "Sky Sports Racing On Sky 415 Novices' Hurdle (GBB Race)",
              "race_id": "799403",
              "course": "Plumpton",
              "course_id": "crs_1144",
              "distance_f": "16",
              "distance_y": "3495",
              "quote": "That was just a huge relief as Aucunrisque was a bit unlucky to get beaten last time and it was very painful. We thought we'd keep it simple and pop out in front. He's very straightforward. He's a good jumper but he's not the biggest in the world. He might jump a fence but if he doesn't he'll be a smashing hurdler. He's got solid form all the way through and backed it up - Chris Gordon, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Aucunrisque",
              "horse_id": "3223906",
              "quote": "His long-term plan had been the Graduation Chase at Carlisle but it was called off due to the weather, so his run at Ascot was a back-up option. He seems in good form and it's great to contest some valuable races with him, but his handicap mark makes things tricky. He's a better-ground horse and he's not very big, so he's largely kept to hurdles, and he just showed his novicey side on Saturday over fences. He finished well though and two miles is probably his trip, so we just need to harden him up a little bit. I think we'll keep him over fences for now as Rex [Dingle] thinks there's very much a chaser in there. 27-11-23"
            },
            {
              "horse": "Aucunrisque",
              "horse_id": "3223906",
              "quote": "I'd love to go up to Kelso with him for the Morebattle Hurdle on Saturday but we'd need the ground to dry up for him. He's a good-ground horse and conditions went against him at Newbury last time. If he doesn't go to Kelso, we might just have a day out at Cheltenham for a bit of fun - he's entered in the County Hurdle. He's effective on good ground or quicker and I think the Sussex Champion Hurdle at Plumpton in April would be a good aim. He won it three years ago. 26-02-25"
            }
          ],
