          "comment": "Runs this track well and returns here after winning a Hexham chase on Sunday; respected",
          "spotlight": "No longer the force of old but came second off today's mark over hurdles at Hexham (2m, good to soft) three weeks ago and seemed to respond well to a change of headgear when winning over fences there (1m7f, good) last Sunday; runs this track well and is fine on soft ground; respected.",
