              "horse": "Glory And Honour",
              "horse_id": "3030298",
              "race": "Living North Handicap Chase (Go North Monet's Garden Series Qualifier)",
              "race_id": "880273",
              "course": "Newcastle",
              "course_id": "crs_962",
              "distance_f": "20",
              "distance_y": "4419",
              "quote": "Glory And Honour is a lovely horse and a joy to ride. He needs a really good gallop as he's such a strong traveller and doesn't find as much as you think he would. Today was an ideal scenario and it played into his hands. It was a nice opportunity to get his head back in front - Jonathan England, jockey."
