          "prev_owners": [],
          "comment": "Awarded 3m5f veterans' chase here last month; this drop back in trip may not be ideal",
          "spotlight": "Three-time course winner, most recently when awarded 3m5f veterans' chase here (good to soft; second past the post) last month; versatile regarding ground but would appeal more over further than 2m5f.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-11-30",
              "horse": "Ilikedwayurthinkin",
              "horse_id": "1879042",
              "race": "BetMGM Handicap Chase",
              "race_id": "880270",
              "course": "Newcastle",
              "course_id": "crs_962",
              "distance_f": "30",
              "distance_y": "6570",
              "quote": "It was a fantastic performance. Ilikedwayurthinkin got into a lovely rhythm and it's sometimes easier to get into a waiting race from the front and that's what Richie [McLernon] did. The ground has a lot to do with it and it's rare it's like this in November. It's massively helped him. The staying veterans races are just perfect for him - Ben Haslam, trainer."
            },
            {
              "date": "2024-11-13",
              "horse": "Ilikedwayurthinkin",
              "horse_id": "1879042",
              "race": "Virgin Bet Daily Extra Places Handicap Chase (Challenger Staying Chase Series Qualifier)",
              "race_id": "879010",
              "course": "Ayr",
              "course_id": "crs_78",
              "distance_f": "24",
              "distance_y": "5300",
              "quote": "I'm delighted with that. Richie gave Ilikedwayurthinkin a great ride from the front, and the plan was to try and expose any flaws or stamina in the other two, and it seems we got the tactics right. He's pretty versatile, so I think he'll keep busy, though I hope he's not penalised too much for this win. There's a couple of staying chases up in the north we'll have a look at now - Ben Haslam, trainer."
            },
            {
              "date": "2022-04-09",
              "horse": "Ilikedwayurthinkin",
              "horse_id": "1879042",
              "race": "EFT Construction Handicap Hurdle (Grade 3) (GBB Race)",
              "race_id": "806351",
              "course": "Aintree",
              "course_id": "crs_832",
              "distance_f": "24.5",
              "distance_y": "5429",
              "quote": "It was a great run and we just bumped into one, and pulled a good way clear of the third. Ilikedwayurthinkin has the option of going back over fences and we'll see - Gavin Cromwell, trainer."
            },
            {
              "date": "2021-10-05",
              "horse": "Ilikedwayurthinkin",
              "horse_id": "1879042",
              "race": "BetVictor Chase",
              "race_id": "794689",
              "course": "Galway",
              "course_id": "crs_4758",
              "distance_f": "22.5",
              "distance_y": "4951",
              "quote": "Ilikedwayurthinkin's jumping let him down a fair bit and he had to dig deep enough in the end. He made four or five fair mistakes and would want to improve a lot on his jumping for a big handicap chase - Gavin Cromwell, trainer."
            },
            {
              "date": "2019-08-04",
              "horse": "Ilikedwayurthinkin",
              "horse_id": "1879042",
              "race": "Adare Manor Opportunity Handicap Hurdle",
              "race_id": "736748",
              "course": "Galway",
              "course_id": "crs_4758",
              "distance_f": "16.5",
              "distance_y": "3680",
              "quote": "Ilikedwayurthinkin got the 2m5f well the other day so it was a bit of a concern coming back to 2m, but he travelled well and he was good. He might get a break now, I'm not sure where we'll go next - Gavin Cromwell, trainer."
            }
          ],
