          "comment": "Absent since winning stable debut in Sligo beginners' chase in October",
          "spotlight": "Returned from layoff with ready win in Sligo begninners' chase (2m5f, good) on stable debut in October but absent since and needs to prove he can cope with a handicap mark this high; effective on good and soft ground.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-11-29",
              "horse": "Great Ocean",
              "horse_id": "3073170",
              "race": "Racing Specials Every Day At PlanetSportBet Handicap Hurdle",
              "race_id": "853088",
              "course": "Hereford",
              "course_id": "crs_624",
              "distance_f": "19.5",
              "distance_y": "4327",
              "quote": "Finishing first and second in a race is never ideal but where are we going to get good ground at the moment? Great Ocean was great, he's got form in the book but he needed that bit of confidence. I'm happy with him and the (Joe Anderson's 5lb) claim helped him - Neil Mulholland, trainer."
            },
            {
              "date": "2022-01-08",
              "horse": "Great Ocean",
              "horse_id": "3073170",
              "race": "Jack Barber \"Racing Dreams\" Syndicate Maiden Hurdle (GBB Race) (Div I)",
              "race_id": "800290",
              "course": "Wincanton",
              "course_id": "crs_2340",
              "distance_f": "15",
              "distance_y": "3350",
              "quote": "Great Ocean has run well enough in his last two races so it's good to see him win. Alan King's horse [Future Investment] ran badly but he should be a lot better than this lot. He is what he is, he's done the job well today. We'll probably look at handicaps now. Philip Hobbs, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Great Ocean",
              "horse_id": "3073170",
              "quote": "He looked to have every chance of winning at the two-furlong pole the other day at Newton Abbot and he was upsides the horse who finished second. He just didn't get home but maybe it was the very soft ground. He's still a nice horse who does everything well and he wasn't beaten that far. He won his point-to-point well in Ireland and I liked him at the sales. He'll go hurdling next time and probably stay over two miles as he's got plenty of pace. 25-10-21"
            }
          ],
