              "quote": "Arthur's Quay showed a bit of class there and I was really pleased with him. Richie (McLernon) felt it might be worth having a crack at the Topham in the spring with him - there was lots going on in that race but he handled it all well and his jumping came to the fore - Ben Haslam, trainer."
