          "comment": "33-1 at Sandown (1m6f, good) latest but finished on the heels of winner Synergism",
          "spotlight": "Won her only 2yo start (1m, heavy) and she's been a quiet improver in defeat since; latest start was handicap at Sandown (1m6f, good; 33-1) in which she finished on the heels of the winner Synergism and saw the trip out well; off an unchanged mark, she may well be in the argument.",
