              "horse": "Personal Best",
              "horse_id": "6102214",
              "race": "British EBF Restricted Maiden Fillies' Stakes (Bands C And D) (GBB Race)",
              "race_id": "876725",
              "course": "Leicester",
              "course_id": "crs_780",
              "distance_f": "8",
              "distance_y": "1813",
              "quote": "We had to talk the co-owner into running Personal Best. Dear Rosa Pease, she's been with me for 26 years and she's the breeder of Personal Best. She probably told me about six times not to run. Thank God the filly has done her well. I just thought they'd need the run today. On this [heavy] ground, you don't know quite what's going to happen. They've not had anything too demanding asked of them at home so I didn't have huge expectations -  Jonathan Portman, trainer, speaking on Racing TV."
