          "comment": "Won a C&D handicap (good) six weeks ago; up 3lb today but he was firmly in charge",
          "spotlight": "Came from a long way off the pace to take second in Grade 1 novice at Aintree (3m, good) in April and, at the second attempt, backed up that form when winning a C&D handicap (good) six weeks ago; up 3lb but firmly in charge last time and may well have more to give.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-04-04",
              "horse": "Minella Rescue",
              "horse_id": "4652681",
              "race": "Oddschecker Sefton Novices' Hurdle (Grade 1) (GBB Race)",
              "race_id": "889464",
              "course": "Aintree",
              "course_id": "crs_832",
              "distance_f": "24.5",
              "distance_y": "5429",
              "quote": "Minella Rescue was a little unlucky last time. We came here thinking that if everything went well for us, he may be top six. We thought 100/1 was a bit embarrassing, so the owners helped themselves to a bit of that. He wants good ground. Now it's out in the open - everyone knows about him. He's got three weeks left as a novice, so it's very tempting to go in a 0-120 novice, but Sean [Bowen] said he had a hard race today, so if he's ok, we'll run him again, and if he isn't, he'll have to wait and run in a handicap. We've got a little race mapped out for him at Galway, at the festival. His jumping's a bit sloppy to go chasing so that might be a bit of a slow burner. He's got a big engine, and that normally counts for most things - Gary Hanmer, trainer."
            },
            {
              "date": "2023-07-23",
              "horse": "Minella Rescue",
              "horse_id": "4652681",
              "race": "Grace & Dotty Open National Hunt Flat Race (Category 1 Elimination) (GBB Race)",
              "race_id": "844317",
              "course": "Stratford",
              "course_id": "crs_1742",
              "distance_f": "16.5",
              "distance_y": "3590",
              "quote": "Minella Rescue looks exceptional. He was recommended to me by some good scouts and Terence was also very complimentary. I think he's everything they've said he'd be. I've got my eye on the bumper at Aintree but we'll take it day by day so we'll see. We've schooled him and he jumps well but I don't want to run over hurdles until we've exhausted the bumper route. It's very exciting - Gary Hanmer, trainer."
            }
          ],
