          "spotlight": "Reliable sort who was runner-up in this race last year; Ludlow (2m5f) in March saw her fourth win over hurdles (all on good ground) and her heavy Haydock defeat in May came in a hot race, but this one is also demanding and she does not look the best handicapped.",
