          "comment": "Partial revival to be competitive last two starts; close last of three to Roger Pol latest",
          "spotlight": "Second at the big Aintree meeting off 14lb higher mark in April 2023; nothing like so good since and although he staged a partial revival to be competitive with this equipment fitted on last two starts, a close last of three to Roger Pol here latest, he needs to build on that.",
