          "comment": "Cheltenham winner in April and only 4lb higher; surprising to see new headgear applied",
          "spotlight": "Outstayed Hymac at Cheltenham in April, winning that 3m2f handicap for a second time (good); a 4lb rise seems very fair and should go well provided an experiment with new headgear doesn't backfire.",
