          "comment": "Won the 2022 Irish Grand National but that level of form is a fading memory",
          "spotlight": "His claim to fame is winning the 2022 Irish Grand National but that level of form is a fading memory; has struggled since returning from a long absence.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-04-18",
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "race": "BoyleSports Irish Grand National Chase (Extended Handicap Chase) (Grade A)",
              "race_id": "808053",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "29",
              "distance_y": "6430",
              "quote": "Our plan was to jump Lord Lariat out, but I was a bit concerned about getting the trip. We wanted to utilise his jumping as he is a good jumper. Paddy said he got plenty of breathers into him and it all worked out well - Dermot McLoughlin, trainer."
            },
            {
              "date": "2021-12-31",
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "race": "Tote Jackpot Is Back Handicap Chase",
              "race_id": "801626",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "23",
              "distance_y": "5100",
              "quote": "Lord Lariat surprised me as I was a bit anxious carrying top-weight on that ground. He's won on proper good ground before. It's probably looser than we thought and he kept galloping. He's improving and maybe he's a bit stronger now to handle that ground - Dermot McLoughlin, trainer."
            },
            {
              "date": "2021-11-27",
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "race": "Fairyhouse Ladies Handicap Chase",
              "race_id": "799145",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "21",
              "distance_y": "4620",
              "quote": "Lord Lariat stayed at it well and the girl used her head. He's been thereabouts for a while and deserved to get over the line. He likes that ground and there might be something for him at Leopardstown - Dermot McLoughlin, trainer."
            },
            {
              "date": "2020-10-10",
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "race": "Adare Manor Opportunity Handicap Chase",
              "race_id": "768818",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "21",
              "distance_y": "4620",
              "quote": "He's a big baby and he's going on his holidays now. He's only five and he'll grow into himself. He jumped super - Karl Thornton, trainer of Lord Lariat"
            },
            {
              "date": "2020-06-26",
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "race": "Junction Handicap Hurdle (Div II)",
              "race_id": "761310",
              "course": "Tipperary",
              "course_id": "crs_5252",
              "distance_f": "20",
              "distance_y": "4400",
              "quote": "He's just a big, raw horse and probably won't be a horse until next year. He's by Golden Lariat, a show jumping stallion who doesn't have many horses but everything he has is okay. He's a grand, fun horse. He'll come back here on Wednesday. He probably wants that nicer ground as well - Karl Thornton, trainer of Lord Lariat"
            }
          ],
          "stable_tour": [
            {
              "horse": "Lord Lariat",
              "horse_id": "2590593",
              "quote": "I think he'll go for the Porterstown Handicap Chase at Fairyhouse next month. He could have one run in the new year before we give him a break and it'll be all systems go for the Grand National at Aintree. He didn't run badly on his comeback at Punchestown ? it was a nice starting point in a small field. 20-11-22"
            }
          ],
