          "comment": "Can go well fresh and competitive in staying chases when last seen; fair mark",
          "spotlight": "3m4f winner in April 2024 and, after a break, he followed up in a novice hurdle; continued to run well afterwards in staying chases, latterly behind Manothepeople at Cheltenham; this mark isn't beyond him; respected.",
          "medical": [
            {
              "date": "2022-06-30",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [
            {
              "date": "2024-04-17",
              "horse": "Hymac",
              "horse_id": "3560321",
              "race": "Gloucester Brewery Holman Handicap Chase",
              "race_id": "863270",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "28",
              "distance_y": "6181",
              "quote": "Hymac was in a great rhythm and it took him two or three runs to really get his confidence over fences. Last time, even though he was runner-up, we were happy with the way he jumped. He was ready to run well in a good race - Harry Fry, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Hymac",
              "horse_id": "3560321",
              "quote": "He took a bit of a blow approaching the last at Ffos Las last time but did well to finish third. He'll be lightly raced this season as I can't wait to see him over a fence next year. He could be one for the EBF Final at Sandown in March, which has produced some good chasers. 11-11-22"
            },
            {
              "horse": "Hymac",
              "horse_id": "3560321",
              "quote": "I still can't believe he got beat in a photo-finish at Chepstow on Welsh National day but that was a good race as he and Saint Davy pulled miles clear. Even though he's had only two runs over hurdles he'll go chasing now over two and a half miles or further. I hope he'll be progressive. 04-10-23"
            }
          ],
