          "owner": "Lynne & Angus Maclennan",
          "owner_id": "own_868700",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Has the form to feature but has been off since February when not at his best",
          "spotlight": "Off a reduced mark when dominating from the front in good-ground handicaps at Sedgefield (3m3f hurdle) and Wincanton (3m1f chase) last autumn and ran well afterwards; however, beaten too far out to blame a trip of nearly 4m in early February and absent since.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-10-17",
              "horse": "Lord Accord",
              "horse_id": "2895377",
              "race": "Fitzdares Handicap Chase",
              "race_id": "876655",
              "course": "Wincanton",
              "course_id": "crs_2340",
              "distance_f": "25",
              "distance_y": "5530",
              "quote": "Lord Accord has been very good to us all. He'd lost his way a little but his runs over hurdles have been a real confidence booster and mentally and physically he's in fantastic order. He's got two or three options, including a couple of races at November's Cheltenham meeting and the Badger Beer back here - Neil Mulholland, trainer, talking to Racing TV."
            },
            {
              "date": "2022-10-22",
              "horse": "Lord Accord",
              "horse_id": "2895377",
              "race": "888Sport Is Made To Play Handicap Chase (GBB Race)",
              "race_id": "821517",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "25",
              "distance_y": "5500",
              "quote": "Lord Accord is a nice staying chaser and it helped having the recent run under his belt. It was good. He does jump and  stay so those sort of races [Coral Gold Cup] that you should be aiming for and having a look at. This horse wouldn't want it too soft which is why Newbury might suit him, we'll run him wherever the ground is nice - Neil Mulholland, trainer."
            },
            {
              "date": "2020-10-21",
              "horse": "Lord Accord",
              "horse_id": "2895377",
              "race": "Heart Of The South Supports Fontwell Maiden Hurdle (GBB Race) (Div I)",
              "race_id": "767088",
              "course": "Fontwell",
              "course_id": "crs_520",
              "distance_f": "19",
              "distance_y": "4229",
              "quote": "Lord Accord has a real good way of going about things as he's very professional, not keen, and his jumping is good - Brendan Powell, jockey."
            }
          ],
          "stable_tour": [
            {
              "horse": "Lord Accord",
              "horse_id": "2895377",
              "quote": "He was a bit unfortunate to unseat early on at Fontwell last time, where the race was won by a horse he'd had back in third when winning his maiden hurdle there the previous month. That race has worked out well, with the runner-up winning since as well, and I suspect he'd have taken a bit of whacking if he'd stood up, although the ground may have been soft enough for him. We'll probably look to freshen him up a bit over Christmas and then look for some better ground. He'll stay hurdling this season. 23-11-20"
            },
            {
              "horse": "Lord Accord",
              "horse_id": "2895377",
              "quote": "He just hasn't had his ground this season. He wants good ground and a staying trip, three and a half miles. I don't think he's gone, he just hasn't had his conditions. There might not be loads of racing for him but I think he could have a good summer. There are lots of local Nationals we could think about running him in, and those staying chases at Cartmel. 06-03-24"
            }
          ],
