          "comment": "Has his tail up but will need to travel better than at Bangor in this higher grade",
          "spotlight": "Opened chase account on 11th attempt when winning by 6l at Bangor (3m, soft) and followed up on his return to hurdling at Ballinrobe (2m6f, good); has his tail up but looked a hard ride at times at Bangor and this is a stronger race, in which he's 8lb higher; Patrick M O'Brien has been riding him.",
