          "comment": "Got outpaced before staying on for third at Aintree (3m1f) and would prefer slower ground",
          "spotlight": "Would probably prefer slower ground and he got outpaced before running on to finish third over 3m1f at Aintree the final time (good; second run for this yard); looks vulnerable for win purposes and he's 1lb wrong at the weights.",
          "medical": [
            {
              "date": "2023-08-14",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [],
          "stable_tour": [
            {
              "horse": "Only The Bold",
              "horse_id": "2922334",
              "quote": "He won his first two starts for us, but the ground was not as soft as they said it was at Haydock on his third run and he was run off his feet a little bit over two and a half miles. He'll be aimed at long-distance chases this term and, while he's not the biggest, he's got a good attitude. 31-10-23"
            },
            {
              "horse": "Only The Bold",
              "horse_id": "2922334",
              "quote": "As a youngster he beat Tommy's Oscar by nine lengths in a point-to-point, and as a result he went for a lot of money to join Evan Williams. He had a couple of seasons with Evan before coming here and he has really thrived since arriving at Pond House. You never know what can bring about a horse's improvement but often a new environment does the job and also I think he was on a nice handicap mark (117). I thought he would go well in his first run for us at Bangor, and he won nicely by nine lengths, but I was even more impressed with him on his second outing at Hereford, where he won a better race. The handicapper has raised him a further 10lb for that run (20 lb in two runs) and I don't think we have seen the best of him yet. He is still a novice and we will look for a nice long-distance novice chase, or handicap for him next. The ground has dried out since his last win and he is definitely a horse who prefers some nice cut, so we could not have run him anyway. He will need another run to get in the big handicaps at Cheltenham or Aintree, but I am not sure whether they would suit him at this stage. I would suggest readers keep this fellow on their side now he is on the up again. 22-02-23"
            }
          ],
