          "comment": "Capable chaser but doesn't always find some fluency over his fences",
          "spotlight": "Last summer's chase wins were over 2m4f/2m5f but he stays further than this; doesn't always find some fluency over his fences and will need to be on his game in this competitive a race, especially from 4lb out of the weights.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-07-07",
              "horse": "Jerrash",
              "horse_id": "3952100",
              "race": "Lives Handicap Chase",
              "race_id": "870236",
              "course": "Market Rasen",
              "course_id": "crs_910",
              "distance_f": "21.5",
              "distance_y": "4709",
              "quote": "The change of scenery has done Jerrash good. This was a lot better race than the one he won at Bangor last time. We'll have three in the Summer Plate [at Market Rasen] now. This horse is still improving. He won off 118 but I can't see him going up that much - Peter Bowen, trainer, speaking to Racing TV."
            }
          ],
          "stable_tour": [
            {
              "horse": "Jerrash",
              "horse_id": "3952100",
              "quote": "I think this horse has a very big future and is one to keep an eye out for. He ran a lovely third to Our Jester (won valuable Lingfield bumper since) on his debut at Ascot and he came on a ton for that experience as he showed late last month at Ascot when winning nicely over 2m5\u00bdf on his hurdling debut. I am not sure how strong the opposition was but he could only do what he did. He must go forward from that but it will be baby steps, nothing to hot too soon. Cheltenham is out of the question as those races are now closed, which is no bad thing. We will take our time as he could be quite smart. 02-02-22"
            }
          ],
