          "comment": "Left James Owen for \u00a35,500; 66-1 and tailed off on stable debut at Worcester",
          "spotlight": "Last win for James Owen came in a seller and was sold on for \u00a35,500; 66-1 and tailed off on stable debut at Worcester.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-09-24",
              "horse": "Honneur d'Ajonc",
              "horse_id": "3300576",
              "race": "AK Bets Watch All UK Racing Handicap Hurdle",
              "race_id": "875625",
              "course": "Fontwell",
              "course_id": "crs_520",
              "distance_f": "17.5",
              "distance_y": "3902",
              "quote": "Honneur d'Ajonc is quite quirky and it's taken a while to get him where he is today. He doesn't like being crowded and didn't enjoy being boxed in on the rails at Perth last time. Today he's had the dream run round - Alex Chadwick, jockey, speaking to Sky Sports Racing."
            },
            {
              "date": "2022-01-11",
              "horse": "Honneur d'Ajonc",
              "horse_id": "3300576",
              "race": "Tribute Cornwall Pale Ale Handicap Hurdle",
              "race_id": "800319",
              "course": "Exeter",
              "course_id": "crs_364",
              "distance_f": "18.5",
              "distance_y": "4071",
              "quote": "We thought we'd lost Honneur D'Ajonc at Kempton last season and it took a long time for him to recover from that, so it's very rewarding to see him going the right way now. He's a proper horse and exactly what we thought he was going to be. This would have been the limit of his stamina but he's versatile and has grown over the last year - Jane Williams, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Honneur d'Ajonc",
              "horse_id": "3300576",
              "quote": "We bought him at Doncaster in the spring. He's won for us and ran very well the other day on heavy ground at Haydock over 2m3f, which is good as it opens up more avenues. I think he'll stay further. New owners at my yard have got involved with him and they've purchased another horse recently, so they're having a good bit of fun. 01-01-25"
            }
          ],
