          "comment": "Bang in form but has been plying his trade in weaker races than this",
          "spotlight": "Continued his good work back from a six-month break when a 2l winner at Southwell (2m, good); has been plying his trade in weaker races than this and he's getting high in the weights.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-20",
              "horse": "Duke Of Luckley",
              "horse_id": "3880911",
              "race": "Sky Sports Racing Sky 415 Handicap Chase (GBB Race)",
              "race_id": "894080",
              "course": "Southwell",
              "course_id": "crs_1586",
              "distance_f": "16",
              "distance_y": "3482",
              "quote": "It was a step up in class and Duke Of Luckley had a lot of weight - it was a big ask. He's a strong traveller and loves jumping. When he gets in a rhythm like that he's gaining a length over his fences. This was his main target for his first run back as he loves it at Southwell. As for future plans, we'll see what the handicapper does and take it from there - Martin Keighley, trainer."
            },
            {
              "date": "2024-10-23",
              "horse": "Duke Of Luckley",
              "horse_id": "3880911",
              "race": "Sky Sports Racing Sky 415 Handicap Chase",
              "race_id": "879806",
              "course": "Southwell",
              "course_id": "crs_1586",
              "distance_f": "16",
              "distance_y": "3482",
              "quote": "Duke Of Luckley loves it around Southwell and takes some stopping from the front there. James [Best] gets on well with him and you have to be brave on him. He'd been a frustrating second at Worcester the last twice, being collared late on having run his heart out, but Southwell suits him better and he's a consistent horse. - Martin Keighley, trainer."
            }
          ],
