              "quote": "We hoped In The Air would win and hopefully he'll improve for the run. He's still a baby, but his next run will be at Aintree in the Grade 1 juvenile. I shouldn't think he'd want extremes of ground and I think he can improve a bit. He's a horse for the future, a bit like Porticello, although he wouldn't be as big as him and I don't think he's quite up to that level yet. Gary Moore, trainer"
