          "comment": "Capable stayer on the Flat; 2-2 over hurdles and looks on a fair mark for handicap debut",
          "spotlight": "Capable stayer on the Flat and has hit the ground running over hurdles with wins at Market Rasen and Fakenham (both at about 2m on good); doesn't look overburdened for this handicap debut.",
          "medical": [],
          "quotes": [
            {
              "date": "2021-08-19",
              "horse": "Howth",
              "horse_id": "3437662",
              "race": "Irish EBF Supporting Irish Champions Weekend Nursery Handicap",
              "race_id": "791372",
              "course": "Killarney",
              "course_id": "crs_4810",
              "distance_f": "8",
              "distance_y": "1790",
              "quote": "Howth is a fine, big horse and looked capable of winning a maiden. It's nice to win one with him - Seamie Heffernan, rider."
            }
          ],
          "stable_tour": [
            {
              "horse": "Howth",
              "horse_id": "3437662",
              "quote": "We might look at the Dee Stakes for him. He has a lot of experience but hasn't gone beyond a mile yet. I think after his first run of the season, which was over seven furlongs, he definitely needs to go up in trip, so Chester could help to tell us where he fits in. 19-04-22"
            },
            {
              "horse": "Howth",
              "horse_id": "3437662",
              "quote": "He was among the Ballydoyle team last year and looks a lovely addition to the team. I managed to get a couple of runs into him at the back end, finishing off with a very encouraging second at Chelmsford. He didn't get a clear run and yet was beaten only half a length. We'll bring him back on the grass this year and hopefully he should be ready to run in May. He has improvement in him and his mark of 92 looks very workable. He's decent over a mile but I feel 1m2f will be his forte. 22-03-23"
            }
          ],
