          "comment": "Dual hurdle winner; went close at York in his penultimate race so in good form",
          "spotlight": "Dual hurdle winner who was a 12l third at Ayr in April, since when he's gone close on the Flat over 1m4f at York in this first-time headgear combination (not so good back there the last time); likely to be involved.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-12-27",
              "horse": "Maghlaak",
              "horse_id": "4423974",
              "race": "William Hill More Top Prices Novices' Hurdle (GBB Race) (Div I)",
              "race_id": "882480",
              "course": "Wetherby",
              "course_id": "crs_2262",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "I'd say Maghlaak is going to be a decent horse, jumping will toughen him up. His bit of class showed there late on and he did that well.  We bought him as a dual-purpose horse and he has a great pedigree - his dam won the Guineas - Adrian Keatley, trainer"
            },
            {
              "date": "2022-09-06",
              "horse": "Maghlaak",
              "horse_id": "4423974",
              "race": "Golf At Goodwood Novice Stakes (GBB Race)",
              "race_id": "818721",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "10",
              "distance_y": "2177",
              "quote": "Maghlaak had a lot of weight, so did it well. I've no idea about plans - Jim Crowley, rider."
            }
          ],
          "stable_tour": [
            {
              "horse": "Maghlaak",
              "horse_id": "4423974",
              "quote": "He finished well to win at Goodwood on his comeback, but he was drawn ten of ten at Redcar last time and could never get any cover. It was a non-event and I'm putting a line through it. He's a pretty talented horse, who likes to get his toe in, and I think the mile and a half would suit him well if he makes the cut. 13-06-24\n"
            },
            {
              "horse": "Maghlaak",
              "horse_id": "4423974",
              "quote": "He has a fabulous pedigree, being by our great sprinter Muhaarar out of our brilliant Guineas and Coronation winner Ghanaati. He's relatively lightly raced with two wins from just five runs and there's still a nice bit more to come from him. His latest run, when second in a 1m2f Haydock handicap late last month, was a very good run as we bumped into Spirit Of The Bay, who showed a very good turn of foot. That was on good to firm, but he has also run well in very soft conditions, so ground is never a worry. I suppose if it were to come up with some dig underfoot it might be more of a benefit to him than most of the others in the Duke of Edinburgh on Friday. If it was rattling quick, we might have a decision to make but he's pretty versatile and going the right way. 21-06-23"
            }
          ],
