          "comment": "Group 1-placed here in 2022, lightly raced in recent seasons, retains plenty of ability",
          "spotlight": "Smart in 2022 for Paddy Twomey, notably when second in the Group 1 Flying Five here on soft; missed 2023 and ran only twice last year; showed he retained ability when second to the British-trained Clarendon House in a Listed 5f race at Cork; returned from 12 months off to finish third in the same race this year, with blinkers on for stable debut; should be sharper now.",
