          "comment": "Equal to the task in a recent three-runner Fairyhouse event, this is much more challenging",
          "spotlight": "Good form in 2023 included back-to-back wins in valuable sales' races at Naas at 6f on good to yielding and 7f on soft; missed 2024 so was entitled to need his comeback in a 6f Listed race at Cork; proved equal to the task in a three-runner Fairyhouse event, this is much more challenging.",
