          "comment": "Has plenty of experience at the highest level, sights lowered this term, holds big chance",
          "spotlight": "7f Group 2 winner here as a juvenile, and runner-up in the Group 1 Moyglare Stakes won by Fallen Angel; Classic-placed in France last year before found wanting in subsequent Grade 1 attempts; sights have been lowered this season; split Big Gossey and My Mate Alfie when fourth in the Greenlands last time, meets that pair on more favourable terms; trip is fine for her.",
