          "comment": "Fair fourth at Naas in his first attempt at a stakes race, this opposition is stronger",
          "spotlight": "Won a C&D maiden last season, returned with a 7f handicap success on testing ground at Naas; ran creditably when third off his revised mark at this venue; beaten a little under 5l when fourth at Naas in his first attempt at a stakes race; this opposition is stronger",
