          "comment": "Decisive winner of a C&D premier handicap last month, could feature in first Listed bid",
          "spotlight": "Picked up an injury when second in last year's Britannia Handicap at Royal Ascot (1m, good to firm) and missed the rest of the season; was having his third start of the current campaign when a decisive winner of a C&D premier handicap last month; now rated 103 and deserves this first shot at a stakes race.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-24",
              "horse": "Skukuza",
              "horse_id": "5176444",
              "race": "QuinnBet Emerald Mile Handicap (Premier Handicap)",
              "race_id": "895763",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "We came here for the rain and it came at the right time. Skukuza deserved to win this. He got injured in the Britannia and things haven't gone right for him. He's a smart horse and the could possibly go to the Hunt Cup next - Ed Dunlop, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Skukuza",
              "horse_id": "5176444",
              "quote": "He's been very lightly raced and was second in the Britannia at Royal Ascot last year. He ran really well that day but picked up an injury and was out for the rest of the season. He returned in a posh handicap at Haydock over 7f on Saturday and finished fifth. We were very pleased with that. We took a chance on the ground but thankfully he's come out well. He should improve significantly as he hadn't run for a year. We'll see if he steps up to stakes races but we'll have a go at the Hunt Cup and races like that first. Physically he's a big beast and I hope he'll improve from three to four. 30-04-25"
            }
          ],
