              "distance_f": "6",
              "distance_y": "1337",
              "quote": "Nick (Hughes, part-owner)'s ambition is for Roman Dragon to become the winningmost horse around Chester and we think he needs six. We're two-thirds of the way there. I'm delighted, he won off 84 last year and 79 here so maybe we can get another before the season's out - Hugo Palmer, trainer."
