              "distance_f": "5",
              "distance_y": "1100",
              "quote": "I think Little Queenie is just getting stronger now and quicker. A good stiff five is probably ideal with a little bit of juice, as she doesn't like it too quick. We had a few different options and went for the slightly better race. It was great to see her winning it - Paul Flynn, trainer."
