          "comment": "Won the Joe McGrath last September, good efforts here the last twice, go well again",
          "spotlight": "Two-time course winner landed the Joe McGrath over C&D in September; got a fair hike in the weights for that but has shaped nicely in both starts this season here over 5f and 6f; should go well again.",
          "medical": [],
