          "quotes": [
            {
              "date": "2024-08-15",
              "horse": "Little Queenie",
              "horse_id": "3652261",
              "race": "Bar One Racing Bet 10 Get 50 Sign Up Offer Mourne Handicap",
              "race_id": "874434",
              "course": "Dundalk (AW)",
              "course_id": "crs_29588",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Little Queenie could go for a Listed race at Tipperary. I think she'll get black type somewhere - Paul Flynn, trainer."
            },
            {
              "date": "2024-07-12",
              "horse": "Little Queenie",
              "horse_id": "3652261",
              "race": "Ladies Day At Dundalk Handicap",
              "race_id": "872486",
              "course": "Dundalk (AW)",
              "course_id": "crs_29588",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Little Queenie is tough and hardy. Ground probably caught us out the last day but she felt 100% today. They went along and I was happy enough to get the box seat and she picked up well - Robert Whearty, rider."
            },
            {
              "date": "2023-11-03",
              "horse": "Little Queenie",
              "horse_id": "3652261",
              "race": "Gateway Hotel Dundalk Race & Stay Handicap",
              "race_id": "853560",
              "course": "Dundalk (AW)",
              "course_id": "crs_29588",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Little Queenie is a legend. I had her entered a good few times in the last few weeks but pulled her out because of the ground. We said one way or the other she was going home after this. She'll keep going next year and if we got a bit of black type the owner would be delighted - Paul Flynn, trainer."
            },
            {
              "date": "2023-08-12",
              "horse": "Little Queenie",
              "horse_id": "3652261",
              "race": "Sheehy Motors Skoda Handicap",
              "race_id": "847255",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "I think Little Queenie is just getting stronger now and quicker. A good stiff five is probably ideal with a little bit of juice, as she doesn't like it too quick. We had a few different options and went for the slightly better race. It was great to see her winning it - Paul Flynn, trainer."
            },
            {
              "date": "2023-07-08",
              "horse": "Little Queenie",
              "horse_id": "3652261",
              "race": "Irish Stallion Farms EBF Fillies & Mares Handicap",
              "race_id": "844877",
              "course": "Naas",
              "course_id": "crs_4992",
              "distance_f": "6",
              "distance_y": "1305",
              "quote": "He gave Little Queenie a lovely ride and there was no one to take her on today. The handicapper has given her a chance as well - Paul Flynn, trainer."
            }
          ],
