          "spotlight": "1m Leopardstown maiden winner last July; followed up in 1m Group 2 Juvenile Stakes at the same venue in September, both times beating Delacroix, the Derby beaten favourite; unbalanced in the Dip when sixth in the 2,000 Guineas; should be fully primed following a workmanlike 1m1f Listed win at Leopardstown early in the month; pedigree implies he can stay this far.",
