          "quotes": [
            {
              "date": "2024-09-14",
              "horse": "Green Impact",
              "horse_id": "6102184",
              "race": "KPMG Champions Juvenile Stakes (Group 2)",
              "race_id": "875386",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Green Impact was always a lovely horse, very laid-back and very easy to train. He's a very big horse and I think we probably haven't seen the best of him yet. We can dream all winter. I think we'll see a really nice horse next year - Jessica Harrington, trainer."
            },
            {
              "date": "2024-07-25",
              "horse": "Green Impact",
              "horse_id": "6102184",
              "race": "Frank Conroy Irish EBF Maiden",
              "race_id": "873224",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Green Impact is a very big and laid back horse. I don't think we will be going anywhere in a hurry. Whatever he does now, he's only going to get better - Jessica Harrington, trainer"
            }
          ],
          "stable_tour": [
            {
              "horse": "Green Impact",
              "horse_id": "6102184",
              "quote": "He's done very well from two to three. He worked at the Curragh after racing last Saturday week and he was excellent, so we're all systems go now for the 2,000 Guineas at Newmarket. I definitely think he's a Guineas type. He can quicken up off a good, fast pace and he's a big, strong horse, so he can take all the hustle and bustle of a race like the Guineas. I think he has enough pace too - he showed enough pace to get to the front at Leopardstown and had enough to stay there. He's uncomplicated, well balanced and he'll take the preliminaries well - he'll be very relaxed, walking around the parade ring with his head on the ground. Nothing fazes him. We're looking forward to the Guineas with him but really looking forward to stepping him up in trip as the season progresses as well. 23-04-25"
            }
          ],
