          "comment": "Chester Vase winner produced a dominant display in the Derby, looks set to complete double",
          "spotlight": "Dam a sprinter, has inherited stamina from his sire Australia, who he emulated in winning the Derby, making almost all and never seriously threatened; chased home by two of these rivals, Lazy Griff and Tennessee Stud, with the fancied Pride Of Arras in rear; had previously accounted for Lazy Griff in the Chester Vase; can now confirm his enhanced reputation on home territory.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-07",
              "horse": "Lambourn",
              "horse_id": "58956386",
              "race": "Betfred Derby (In Honour Of His Highness Aga Khan IV) (Group 1) (No Geldings)",
              "race_id": "887145",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "Australia [Lambourn's sire] is a great Derby winner, very genuine, and that's what Lambourn is - uncomplicated, genuine and committed. He always has been. His runs this year have been very good - he was second to Delacroix, and then was very impressive in Chester. Chester again - you have to be on your game and you have to stay, and that's the way he was. Ryan loved him in Chester and he obviously can't ride them all. He was always going to be an Irish Derby horse, a Leger horse, and Wayne said he definitely would stay further. He saves plenty for himself and he gives himself a chance to get any trip - Aidan O'Brien, trainer."
            },
            {
              "date": "2025-05-07",
              "horse": "Lambourn",
              "horse_id": "58956386",
              "race": "Boodles Chester Vase Stakes (Group 3) (Colts & Geldings)",
              "race_id": "892640",
              "course": "Chester",
              "course_id": "crs_338",
              "distance_f": "12.5",
              "distance_y": "2703",
              "quote": "Lambourn looked a thorough stayer and while he was a little on and off the bridle, once the penny dropped he came home really strongly. He got the trip really well and he's gone through the line nicely. We'll just have to see how they all get on in the trials but we were thinking of sending him to Epsom as they learn so much when they go to Chester - Aidan O'Brien, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Lambourn",
              "horse_id": "58956386",
              "quote": "We were very happy with his run when second in the Ballysax behind Delacroix and he's come out of it well. We were delighted with it for his first run of the season and he looks like a horse who will get further. 07-04-25"
            }
          ],
