          "comment": "Impressive Dante winner, dismal run in the Derby, too many doubts about the Dante form",
          "spotlight": "Impressed despite betraying inexperience when winning a 1m maiden on good at Sandown; on sole 2yo start; became a strong Derby candidate after his winning return in the Group 2 Dante at York; nothing went right for him at Epsom (bumped at the start, failed to settle well, raced wide); one bad run can be forgiven, but wider doubts about the Dante form abound.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-07",
              "horse": "Pride Of Arras",
              "horse_id": "6270353",
              "race": "Betfred Derby (In Honour Of His Highness Aga Khan IV) (Group 1) (No Geldings)",
              "race_id": "887145",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "It looks as if Pride of Arras didn't come down the hill. He came on the bridle at the top of the hill but then he was on the wrong leg and it was the wrong way round so it was all over - Ralph Beckett, trainer. Pride Of Arras was very inexperienced for this track. He wasn't comfortable coming down the hill - Rossa Ryan, jockey."
            },
            {
              "date": "2025-05-15",
              "horse": "Pride Of Arras",
              "horse_id": "6270353",
              "race": "Al Basti Equiworld Dubai Dante Stakes (Group 2)",
              "race_id": "890435",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "10.5",
              "distance_y": "2256",
              "quote": "Pride Of Arras is not Westover, he's not Bluestocking. He does have a very good back pedigree but he doesn't have perhaps the profile of those when it comes to pedigree. But he has more speed than Westover did and he's a better workhorse. It's all in front of us, I hope. If he handles Epsom, which I think he will, and he handles the jamboree, which based on today I think he will, we've every right to think he's going there to be competitive. What happens after that, who knows? - Ralph Beckett, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Pride Of Arras",
              "horse_id": "6270353",
              "quote": "He was pretty impressive on his debut in August and then he had an issue. He's in good form now and I think he's going to go for the Dante. His owner is from Yorkshire and his work would suggest that's a good place to start. 28-04-25"
            }
          ],
