          "comment": "Finishing strongly for third in the Derby, holds a fighting chance in the rematch",
          "spotlight": "Coped with heavy ground to beat Green Storm in three-runner Group 1 Criterium de Saint-Cloud (1m2f) last October; needed the race and unsuited by a muddling gallop and quick ground when around 7l third behind Delacroix in the Ballysax in May; did best of those who came from off the pace when finishing strongly for third in the Derby; holds a fighting chance in the rematch.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-07",
              "horse": "Tennessee Stud",
              "horse_id": "6256736",
              "race": "Betfred Derby (In Honour Of His Highness Aga Khan IV) (Group 1) (No Geldings)",
              "race_id": "887145",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "Tennessee Stud ran great. He was a little bit slower into his stride than we maybe expected, but it was a really good run. Very proud of the horse, a great ride from Dylan and I'm delighted for all of the owners - Joseph O'Brien, trainer."
            },
            {
              "date": "2024-10-27",
              "horse": "Tennessee Stud",
              "horse_id": "6256736",
              "race": "Criterium de Saint-Cloud (Group 1) (2yo Colts & Fillies) (Turf)",
              "race_id": "880505",
              "course": "Saint-Cloud",
              "course_id": "crs_5694",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Dylan [Browne McMonagle, jockey] gave Tennessee Stud a fantastic ride, he said he was really struggling on that ground and he never felt comfortable at any stage. I think it's quite heavy there. It's testament to his attitude he was able to fight and fight and still win at the line. He's very big and I expect him to be better as a three-year-old. He'll have a break and he'll be trained now with the Derby at Epsom being his target. He could run in one or two trial races - Joseph O'Brien, trainer."
            },
            {
              "date": "2024-09-01",
              "horse": "Tennessee Stud",
              "horse_id": "6256736",
              "race": "Camas Park Stud Irish EBF Maiden",
              "race_id": "875563",
              "course": "Tipperary",
              "course_id": "crs_5252",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "Tennessee Stud has sharpened up a lot and did well. He's a good staying horse and a Derby Trial horse for next season - Declan McDonogh, jockey."
            }
          ],
          "stable_tour": [
            {
              "horse": "Tennessee Stud",
              "horse_id": "6256736",
              "quote": "He won the Criterium de Saint-Cloud on his last start and the feeling here was that he did it despite the ground as it was a real slog that day. He's wintered very well and has matured and progressed so we're very excited about him. He ran late last year so it was always the plan to miss the early Derby trials this season. He'll go to Leopardstown on May 11 for the Derby trial and from there on to Epsom. His pedigree has plenty of pace in it and is really more of a mile pedigree, even though he's out of a Sadler's Wells mare, so it wouldn't be absolutely guaranteed he'd get a mile and a half. We'll evaluate it after Leopardstown and Epsom. 24-04-25"
            }
          ],
