          "comment": "Three-time Listed winner, not disgraced on h'cap bow latest, rider claims 7lb, go well",
          "spotlight": "Talented and mostly consistent sort is 5-10; three-time Listed winner at 12.5f-2m; not disgraced in first handicap here (1m6f, good) on seasonal return earlier this month; dropped 1lb and rider claims 7lb; could go well back in trip.",
