          "comment": "C&D winner, signs of life over 1m2f here latest, promising rider claims 7lb, could go well",
          "spotlight": "One of two for yard; enjoyed a purple-patch in 2023 when winning three in a row (including a Listed race over C&D); lost way subsequently but signs of life when beaten just 3.25l here last month (1m2f, good); promising rider takes off 7lb; likes quick ground; could go well.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-01",
              "horse": "Mashhoor",
              "horse_id": "3175850",
              "race": "Paddy Power International Stakes (Group 3)",
              "race_id": "843490",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "You'd have to say Mashhoor has improved immensely. He's been very straightforward this year. There was no pace today so I said to Ben (Coen) to just let him roll along as he leads the string at home. I knew when they turned in that they weren't going to get to him, as he wasn't going to stop because he won over a mile and a half last time - Johnny Murtagh, trainer."
            },
            {
              "date": "2023-05-27",
              "horse": "Mashhoor",
              "horse_id": "3175850",
              "race": "FBD Hotels & Resorts Orby Stakes (Listed Race)",
              "race_id": "841877",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "That was great. Mashoor has been training really well at home and showing all the right signs that he had improved. I'm really delighted the way he won today. He can win at 1m2f and now he can get 1m4f so there are plenty of races for him - Johnny Murtagh, trainer"
            },
            {
              "date": "2022-05-21",
              "horse": "Mashhoor",
              "horse_id": "3175850",
              "race": "William Hill Handicap (Premier Handicap)",
              "race_id": "813171",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Mashhoor ran very well in Cork on his first run and he had a very good draw today, and was given a very good ride by Shane. He's mentally immature but is toughening up now and being by Kingman I'd say he has loads of class - Johnny Murtagh, trainer."
            },
            {
              "date": "2021-04-07",
              "horse": "Mashhoor",
              "horse_id": "3175850",
              "race": "MansionBet Bet 10 Get 20 Novice Stakes",
              "race_id": "779357",
              "course": "Nottingham",
              "course_id": "crs_1040",
              "distance_f": "8.5",
              "distance_y": "1835",
              "quote": "Mashhoor ran well on debut last year and learnt plenty from that and will have done the same today. He's a strong traveller but picked up nicely and showed a good attitude to go through the gaps - Richard Kingscote, jockey."
            }
          ],
