          "comment": "Dual-purpose, good efforts here last twice at 1m2f-1m6f, capable off this mark, e/w chance",
          "spotlight": "Dual-purpose; won a 2m maiden hurdle at Naas in April; short of room when behind a few of these over 1m2f here in May; creditable effort when an 8.5l fourth of 13 over 1m6f here latest; went close in Cork Derby off 91 last June and 5lb lower now; interesting.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-10-15",
              "horse": "Zoffman",
              "horse_id": "3689366",
              "race": "Leopardstown October Handicap (Premier Handicap)",
              "race_id": "823713",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "I think going up in trip and getting on to easy ground has been a help to Zoffman. Today he even looked like getting further. He's very small and I thought with a low weight he had a great chance. You're always surprised when they win as easy as that, but you're probably getting a free 7lb with Jamie Powell. He jumps quite well but won't be going hurdling at this time anyway. I couldn't imagine he'd make a jumper being so small - Noel Meade, trainer."
            },
            {
              "date": "2022-09-25",
              "horse": "Zoffman",
              "horse_id": "3689366",
              "race": "William Hill Play Responsibly Maiden",
              "race_id": "822142",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Zoffman has run some very good races and it's only clear to us now that he wants ease in the ground, and maybe 1m4f. He really quickened for Dylan too. He might win a good handicap on soft ground - Noel Meade, trainer."
            }
          ],
