              "quote": "White Clover will probably run again, we will see what the handicapper does but the intention was to run her again. I took a little punt and put her in that Mallow handicap in three weeks and if she got in at the bottom of the weight she could have a little squeak over seven furlongs. We were hoping we would win today to get her into it. She has been threatening to be a good filly for a good few years now so we will find out shortly if she is or not - Joseph Murphy, trainer."
