              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Dartan had some good form last year, but had a bit of a setback so we let him off for the rest of the summer. I had faith in him and knew he was good enough to win. I told Declan to make plenty of use of him and he gave him a great ride. He stays well and he is a nice horse - Matt Smith, trainer."
