          "prev_owners": [],
          "comment": "Veteran is best known as a six-time chase winner, a thorough stayer, won on Flat last year",
          "spotlight": "Veteran is best known as a six-time chase winner, most recently scoring at Kilbeggan on the first of three starts after a winter break; won last year's Ulster Cesarewitch over 2m2f at Downpatrick; no stamina doubts, but vulnerable in this company.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-09-06",
              "horse": "Happy Jacky",
              "horse_id": "1897862",
              "race": "Grant Thornton Ulster Cesarewitch Handicap",
              "race_id": "876176",
              "course": "Down Royal",
              "course_id": "crs_4680",
              "distance_f": "18.5",
              "distance_y": "4101",
              "quote": "Happy Jacky kept on finding and he gives it to you when you need it. I got him rolling up the hill, which probably isn't the best thing to do, but one thing Mark said was don't give them a chance to quicken by you. So I was happy enough to go earlier and get beat rather than go later - Ronan Whelan, jockey, speaking to Racing TV."
            },
            {
              "date": "2022-05-16",
              "horse": "Happy Jacky",
              "horse_id": "1897862",
              "race": "Beaufort Golf Club Handicap Hurdle",
              "race_id": "812821",
              "course": "Killarney",
              "course_id": "crs_4810",
              "distance_f": "22",
              "distance_y": "4890",
              "quote": "We fancied Happy Jacky today, we thought he would take a bit of stopping. I got a lovely split through, the horse in front kept jumping to his right, so I got a lovely gap. It was nice to get it - Bryan Cooper, jockey."
            },
            {
              "date": "2019-09-05",
              "horse": "Happy Jacky",
              "horse_id": "1897862",
              "race": "Giantsgrave Handicap Hurdle",
              "race_id": "739245",
              "course": "Clonmel",
              "course_id": "crs_4602",
              "distance_f": "16.5",
              "distance_y": "3601",
              "quote": "Happy Jacky toughed it out well on his last chance in that grade. I would say that trip is the shortest he would want. I might give him a pop over a fence before the ground turns heavy - Ray Hackett, trainer"
            },
            {
              "date": "2019-08-27",
              "horse": "Happy Jacky",
              "horse_id": "1897862",
              "race": "David Heneghan Memorial Handicap Hurdle",
              "race_id": "738527",
              "course": "Ballinrobe",
              "course_id": "crs_4550",
              "distance_f": "18.5",
              "distance_y": "4044",
              "quote": "I was worried that the ground might have gone for him but he's a hardy little lad and got through it alright. He wouldn't be in love with it, but is tough. It didn't work out when he got boxed in at Killarney and got no run but he finished out his race really well. After two quick runs we'll give him a little rest, although he could go to Listowel - Ray Hackett, trainer of Happy Jacky"
            }
          ],
